import React from "react";

const Card =(props)=>{
    return(
        <div className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5"> 
            <img alt="onions" src="vegetables/carrots.png"></img>
            <div>
                <h2>{props.name}</h2>
                <h3>{props.type}</h3>
                <h4>{props.season}</h4>
            </div>
        </div>
    );
}


export default Card;
